def trlower(metin):
    """
        Trke kk harfe evirir
        Python da katar veri tipi ile ykl gelen kk harfe evirici lower fonksyionu I ve  harflerini
        doru evrimez. trlower fonksiyonu bu hatay zmektedir.
        Parametre:
            metin: Kk harfe evrilecek metin
        Dndrd Sonu:
            Trke kk harf hali
    """

    def trlower_(harf):
        if harf=='I': sonu = ''
        elif harf=='': sonu = 'i'
        else: sonu = harf.lower()
        return sonu

    sonu = ''
    for i in metin:
        sonu += trlower_(i)

    return sonu

def trupper(metin):
    """
        Trke byk harfe evirir
        Python da katar veri tipi ile ykl gelen byk harfe evirici upper fonksyionu I ve  harflerini
        doru evrimez. trupper fonksiyonu bu hatay zmektedir.
        Parametre:
            metin: Byk harfe evrilecek metin
        Dndrd Sonu:
            Trke byk harf hali
    """

    def trupper_(harf):
        if harf=='': sonu = 'I'
        elif harf=='i': sonu = ''
        else: sonu = harf.upper()
        return sonu

    sonu = ''
    for i in metin:
        sonu += trupper_(i)

    return sonu


